import React from "react";
import { Button } from "reactstrap";
import "./css-components/nav-bar.css";
import logo from "./errandslogo.png";

function Navbar() {
  return (
    <div className="bar">
      <Button color="danger" className="login-nav-bar">
        Danger!
      </Button>
      <img src={logo} alt="logo" className="logo-nav-bar" />
    </div>
  );
}

export default Navbar;
